/*Table structure for table `diagnosis` */

DROP TABLE IF EXISTS `diagnosis`;

CREATE TABLE `diagnosis` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `client_id` int(11) NOT NULL,
  `clinic_id` int(11) NOT NULL,
  `appointment_date` datetime NOT NULL,
  `appointment_id` int(11) NOT NULL DEFAULT '1' COMMENT 'Remove the default appointment_id set to 1',
  `temperature` float DEFAULT NULL,
  `weight` float DEFAULT NULL,
  `height` float DEFAULT NULL,
  `blood_pressure` varchar(150) DEFAULT NULL,
  `arm_circumference` float DEFAULT NULL,
  `head_circumference` float DEFAULT NULL,
  `diagnosis_subjective` varchar(250) DEFAULT NULL,
  `diagnosis_objective` varchar(250) DEFAULT NULL,
  `diagnosis_assesment` varchar(250) DEFAULT NULL,
  `description` varchar(150) DEFAULT NULL,
  `is_active` enum('0','1') NOT NULL DEFAULT '1',
  `medica_staff_id` int(11) NOT NULL,
  `prescription_drug` varchar(150) NOT NULL,
  `prescription_drug_comments` varchar(250) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `FK_diagnosis__appointments` (`appointment_id`),
  CONSTRAINT `FK_diagnosis__appointments` FOREIGN KEY (`appointment_id`) REFERENCES `appointments` (`id`) ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;

/*Data for the table `diagnosis` */

insert  into `diagnosis`(`id`,`client_id`,`clinic_id`,`appointment_date`,`appointment_id`,`temperature`,`weight`,`height`,`blood_pressure`,`arm_circumference`,`head_circumference`,`diagnosis_subjective`,`diagnosis_objective`,`diagnosis_assesment`,`description`,`is_active`,`medica_staff_id`,`prescription_drug`,`prescription_drug_comments`) values (1,3,2,'2016-04-02 11:00:00',2,37,74,1.6,'120/80',NULL,NULL,'Upper left back pain, physical exhaustion from small activities, drowsiness, memory loss','Restlessness, weariness',NULL,NULL,'1',1,'1',''),(2,11,4,'2016-09-06 00:00:00',1,37,67,1.8,'121/79',NULL,NULL,'Sore throat experienced mostly during cold weather. Occasional loss of voice and pain when talking for extended periods','Inflamed throat due to untreated bouts of sore throat. Raspy voice and prolonged dry cough','Possible infection of upper throat.',NULL,'1',3,'Azaprin, 10 tablets','Azaprin, 1 tablet to be taken twice daily for 5 days after meals.'),(3,12,8,'2016-09-05 00:00:00',1,36,62,1.5,'120/80',NULL,NULL,'Vision at night not clear even when there is light in room. Itchy eyes','Swollen eyes, redness in both eyes','Possible poor eye care and prolonged use of wrong lenses',NULL,'1',6,'Eye drops 15ml','Apply 2 drops twice daily');

