/*Table structure for table `drugs_copy` */

DROP TABLE IF EXISTS `drugs_copy`;

CREATE TABLE `drugs_copy` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `brand_name` varchar(150) NOT NULL,
  `generic_name` varchar(255) NOT NULL,
  `dosage_form` varchar(150) DEFAULT NULL,
  `strength` varchar(50) DEFAULT NULL,
  `re_order_level` int(11) DEFAULT NULL,
  `package_type` varchar(150) NOT NULL,
  `shelf_life_months` int(11) NOT NULL,
  `manufacturer` varchar(150) NOT NULL,
  `route_of_administration` varchar(150) NOT NULL,
  `package_size` int(11) NOT NULL,
  `description` varchar(150) DEFAULT NULL,
  `is_active` enum('0','1') NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`)
