/*Table structure for table `drugs_movement` */

DROP TABLE IF EXISTS `drugs_movement`;

CREATE TABLE `drugs_movement` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `drug_id` int(11) NOT NULL,
  `prescribing_medical_staff_id` int(11) NOT NULL,
  `date_dispensed` datetime NOT NULL,
  `client_id` int(11) NOT NULL,
  `dispensing_staff_id` int(11) NOT NULL,
  `appointment_id` int(11) NOT NULL,
  `pharmacy_id` int(11) NOT NULL,
  `prescription_id` int(11) DEFAULT NULL,
  `quantity` float NOT NULL,
  `unit_cost` float NOT NULL,
  `discount` float NOT NULL DEFAULT '0',
  `total_cost` float NOT NULL,
  `batch_number` varchar(50) NOT NULL,
  `is_active` tinyint(1) NOT NULL DEFAULT '1',
  `indications` varchar(150) DEFAULT NULL,
  `description` varchar(150) DEFAULT NULL,
  `price` float NOT NULL,
  PRIMARY KEY (`id`),
  KEY `FK_drugs_movement__pharmacy` (`drug_id`),
  KEY `FK_drugs_movement__prescriptions` (`prescription_id`),
  CONSTRAINT `FK_drugs_movement__pharmacy` FOREIGN KEY (`drug_id`) REFERENCES `drugs` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `FK_drugs_movement__prescriptions` FOREIGN KEY (`prescription_id`) REFERENCES `prescriptions` (`id`) ON UPDATE CASCADE
