/*Table structure for table `drugs_received` */

DROP TABLE IF EXISTS `drugs_received`;

CREATE TABLE `drugs_received` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `date_received` date NOT NULL,
  `pharmacy_id` int(11) NOT NULL,
  `drug_id` int(11) NOT NULL,
  `supplier_id` int(11) NOT NULL,
  `receiving_staff_id` int(11) NOT NULL,
  `quantity` int(11) NOT NULL,
  `packaging_size` varchar(100) DEFAULT NULL,
  `cost_per_unit` float NOT NULL,
  `batch_number` varchar(50) DEFAULT NULL,
  `is_active` tinyint(1) NOT NULL DEFAULT '1',
  `description` varchar(150) DEFAULT NULL,
  `date_manufactured` date NOT NULL,
  `date_expiry` date NOT NULL,
  PRIMARY KEY (`id`),
  KEY `FK_drugs_received__drygs` (`drug_id`),
  KEY `FK_drugs_received__suppliers` (`supplier_id`),
  CONSTRAINT `FK_drugs_received__drygs` FOREIGN KEY (`drug_id`) REFERENCES `drugs` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `FK_drugs_received__suppliers` FOREIGN KEY (`supplier_id`) REFERENCES `suppliers` (`id`) ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;

/*Data for the table `drugs_received` */

insert  into `drugs_received`(`id`,`date_received`,`pharmacy_id`,`drug_id`,`supplier_id`,`receiving_staff_id`,`quantity`,`packaging_size`,`cost_per_unit`,`batch_number`,`is_active`,`description`,`date_manufactured`,`date_expiry`) values (1,'2016-08-01',1,1,1,1,10,'12',600,'Q40500',1,NULL,'2016-01-05','2016-12-31'),(2,'2016-08-16',1,2,1,8,20,'12',1000,'HT7281',1,'Delivered by DHL truck','2016-05-02','2017-05-01'),(3,'2017-01-03',1,10,2,9,250,'10',50,'XK627',1,'All packages received in proper condition','2016-09-01','2017-07-31');

/*Table structure for table `expenses` */

DROP TABLE IF EXISTS `expenses`;

CREATE TABLE `expenses` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `expense` varchar(150) NOT NULL,
  `quantity` float NOT NULL DEFAULT '1',
  `unit_amount` float DEFAULT NULL,
  `date_of_expense` date DEFAULT NULL,
  `payee_id` int(11) DEFAULT NULL,
  `description` varchar(150) DEFAULT NULL,
  `is_active` enum('0','1') NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`),
  KEY `FK_expenses__payee` (`payee_id`),
  CONSTRAINT `FK_expenses__payee` FOREIGN KEY (`payee_id`) REFERENCES `payees` (`id`) ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

