/*Table structure for table `inventory_items` */

DROP TABLE IF EXISTS `inventory_items`;

CREATE TABLE `inventory_items` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `inventory_item` varchar(150) NOT NULL,
  `inventory_item_type` enum('pharmaceutical','non-pharmaceutical') NOT NULL,
  `re-order_level` int(11) NOT NULL DEFAULT '0',
  `description` varchar(150) DEFAULT NULL,
  `is_active` tinyint(1) NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;

/*Data for the table `inventory_items` */

insert  into `inventory_items`(`id`,`inventory_item`,`inventory_item_type`,`re-order_level`,`description`,`is_active`) values (3,'Tissue paper','non-pharmaceutical',4,NULL,2);

