/*Table structure for table `radiology_exam_requests` */

DROP TABLE IF EXISTS `radiology_exam_requests`;

CREATE TABLE `radiology_exam_requests` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `date_requested` date NOT NULL,
  `client_id` int(11) NOT NULL,
  `radilogy_exam_id` int(11) NOT NULL,
  `requesting_doctor_id` int(11) NOT NULL,
  `requesting_doctor_comments` varchar(250) DEFAULT NULL,
  `date_performed` date DEFAULT NULL,
  `radiologist_id` int(11) DEFAULT NULL,
  `radiologists_comments` varchar(250) DEFAULT NULL,
  `is_active` tinyint(1) NOT NULL DEFAULT '1',
  `appointment_id` int(11) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `FK_radiology_exam_requests__appointments` (`appointment_id`),
  CONSTRAINT `FK_radiology_exam_requests__appointments` FOREIGN KEY (`appointment_id`) REFERENCES `appointments` (`id`) ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;

/*Data for the table `radiology_exam_requests` */

insert  into `radiology_exam_requests`(`id`,`date_requested`,`client_id`,`radilogy_exam_id`,`requesting_doctor_id`,`requesting_doctor_comments`,`date_performed`,`radiologist_id`,`radiologists_comments`,`is_active`,`appointment_id`) values (1,'2016-10-13',3,2,2,'Perfom CT-Scan on patient',NULL,NULL,NULL,1,2),(2,'2016-10-13',8,3,6,'Perform MIR on patient','2016-10-13',5,'MRI performed and reports sent',1,9);

