/* Procedure structure for procedure `stored_procedure_reports_all_clients` */

/*!50003 DROP PROCEDURE IF EXISTS  `stored_procedure_reports_all_clients` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `stored_procedure_reports_all_clients`(IN date_from VARCHAR(255), IN client_types VARCHAR(255))
BEGIN
TRUNCATE TABLE arv_adherence.reports_all_clients;
INSERT INTO arv_adherence.reports_all_clients(category,total_count)
SELECT "On Time" AS category,COUNT(*) AS total_count FROM(
SELECT reminder_type,DATE(time_stamp),patient_number,gender FROM messages INNER JOIN testadt.patient ON messages.patient_number=testadt.patient.patient_number_ccc
WHERE reminder_type='rs' AND client_type=client_types AND SUBDATE(date_from,92)=DATE(time_stamp)) AS art_reports;
INSERT INTO arv_adherence.reports_all_clients(category,total_count)
SELECT "Missed Appointments" AS category,COUNT(*) AS total_count FROM(
SELECT reminder_type,DATE(time_stamp),patient_number,gender FROM messages INNER JOIN testadt.patient ON messages.patient_number=testadt.patient.patient_number_ccc
WHERE reminder_type='rm' AND client_type=client_types AND SUBDATE(date_from,88)=DATE(time_stamp)) AS art_reports;
INSERT INTO arv_adherence.reports_all_clients(category,total_count)
SELECT "Defaulters" AS category,COUNT(*) AS total_count FROM(
SELECT reminder_type,DATE(time_stamp),patient_number,gender FROM messages INNER JOIN testadt.patient ON messages.patient_number=testadt.patient.patient_number_ccc
WHERE reminder_type='rd' AND client_type=client_types AND SUBDATE(date_from,77)=DATE(time_stamp)) AS art_reports;
INSERT INTO arv_adherence.reports_all_clients(category,total_count)
SELECT "Lost Follow Up" AS category,COUNT(*) AS total_count FROM(
SELECT reminder_type,DATE(time_stamp),patient_number,gender FROM messages INNER JOIN testadt.patient ON messages.patient_number=testadt.patient.patient_number_ccc
WHERE reminder_type='rl' AND client_type=client_types AND SUBDATE(date_from,1)=DATE(time_stamp)) AS art_reports;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `stored_procedure_reports_clients_by_age` */

/*!50003 DROP PROCEDURE IF EXISTS  `stored_procedure_reports_clients_by_age` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `stored_procedure_reports_clients_by_age`(IN date_from VARCHAR(255), IN client_types VARCHAR(255))
BEGIN
TRUNCATE reports_all_clients_by_age;
INSERT INTO arv_adherence.reports_all_clients_by_age(age,category,total_count)
SELECT 'Children' AS age, "On Time" AS category,COUNT(*) AS total_count FROM(
SELECT reminder_type,DATE(time_stamp),patient_number,dob FROM messages INNER JOIN testadt.patient ON messages.patient_number=testadt.patient.patient_number_ccc
WHERE reminder_type='rs' AND client_type=client_types AND SUBDATE(date_from,92)=DATE(time_stamp) AND TIMESTAMPDIFF(YEAR,DATE(dob),DATE(NOW())) < 15) AS art_reports;
INSERT INTO arv_adherence.reports_all_clients_by_age(age,category,total_count)
SELECT 'Youth' AS age, "On Time" AS category,COUNT(*) AS total_count FROM(
SELECT reminder_type,DATE(time_stamp),patient_number,dob FROM messages INNER JOIN testadt.patient ON messages.patient_number=testadt.patient.patient_number_ccc
WHERE reminder_type='rs' AND client_type=client_types  AND SUBDATE(date_from,92)=DATE(time_stamp) AND TIMESTAMPDIFF(YEAR,DATE(dob),DATE(NOW()))BETWEEN 15 AND 24) AS art_reports;
INSERT INTO arv_adherence.reports_all_clients_by_age(age,category,total_count)
SELECT 'Adults' AS age, "On Time" AS category,COUNT(*) AS total_count FROM(
SELECT reminder_type,DATE(time_stamp),patient_number,dob FROM messages INNER JOIN testadt.patient ON messages.patient_number=testadt.patient.patient_number_ccc
WHERE reminder_type='rs' AND client_type=client_types  AND SUBDATE(date_from,92)=DATE(time_stamp) AND TIMESTAMPDIFF(YEAR,DATE(dob),DATE(NOW()))> 24) AS art_reports;
INSERT INTO arv_adherence.reports_all_clients_by_age(age,category,total_count)
